--net has a syntax that supports auto network discovery i.e --net=container:name. If you use this syntax, docker will automatically connect network that is used by specified container. If you use this syntax, you will be able to use localhost instead of container_name . Run the image that has our app like before. ➜ docker run \ --name=myApp --net=myNet -p 9090:8080 -d amantuladhar/doc-kub-ws:web-basic Run the tester again with container syntax. docker run \ --name=myTester \ --net=container:myApp \ -it \ amantuladhar/network-tools \ sh Test using localhost, and it just works. / # curl localhost:8080/test | jq .
{ "message": "Hello Fellas!!!", "host.address": "172.23.0.3", "app.version": "v1-web"
} As exercise, you can try to create application that stores some values in database. You can use amantuladhar/docker-kubernetes:v1-db image. Simple Web App at branch initial-db App expects that you will set DB_URL, DB_USER and DB_PASS environment variable, which is a full connection URL for mysql.
